import React from "react";
import { Link } from "react-router-dom";

const Navbar = () => {
  return (
        <nav class="navbar navbar-expand-lg bg-secondary text-uppercase fixed-top" id="mainNav">
            <img src="../logo.svg" class="logo" alt="" />
            <div class="container">
               <a class="navbar-brand js-scroll-trigger brand-logo" href="#page-top"> Mu Women In Stem</a>
                <button class="navbar-toggler navbar-toggler-right text-uppercase font-weight-bold bg-primary text-white rounded" type="button" data-toggle="collapse" data-target="#navbarResponsive" aria-controls="navbarResponsive" aria-expanded="false" aria-label="Toggle navigation">
                    Menu
                    <i class="fas fa-bars"></i>
                </button>
                <div class="collapse navbar-collapse" id="navbarResponsive">
                    <ul class="navbar-nav ml-auto">
                    <li class="nav-item mx-0 mx-lg-1"> <Link to="/" class="nav-link py-3 px-0 px-lg-3 rounded js-scroll-trigger">About</Link></li>
                    <li class="nav-item mx-0 mx-lg-1"> <Link to="/add" class="nav-link py-3 px-0 px-lg-3 rounded js-scroll-trigger">Events</Link></li>
                    <li class="nav-item mx-0 mx-lg-1"> <Link to="/blogs" class="nav-link py-3 px-0 px-lg-3 rounded js-scroll-trigger">Blogs</Link></li>
                   </ul>
                </div>
            </div>
        </nav>
   );
};

export default Navbar;
